import React from 'react'
import '../css/pages/contact.scss'

function Contact() {
  return (
    <div className='contact-container'>
      <div className="presentation">
        <h2 className='contact-title'>Contact</h2>
        <p>Vous souhaitez me contacter ?</p>
      </div>
    </div>
  )
}

export default Contact
